import { useState, useEffect } from 'react'

function ShowGames() {
    const [games, setGames] = useState([])
    useEffect( () => {axios.get('http://localhost:3001/videogames')
    .then(response => {
        setGames(oldGames => [...oldGames, response.data])
    })},[])
   
    console.log(games)
    return(
       <></>
    )
}


export default ShowGames
